import React, { useEffect, useState } from 'react';
import './Slider.css'; // SCSS 파일 import

function Slider() {
  const [fromValue, setFromValue] = useState(10);
  const [toValue, setToValue] = useState(30);

  useEffect(() => {
    // 여기에 이전 JavaScript 코드의 일부를 이동할 수 있습니다.
  }, []);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    // input 요소의 값이 변경될 때 상태 업데이트를 처리할 함수
    const { name, value } = e.target;
    if (name === 'from') {
      setFromValue(+value);
    } else if (name === 'to') {
      setToValue(+value);
    }
  };

  // 여기에 다른 함수와 스타일을 정의할 수 있습니다.

  return (
    <div id="foo" className="slider range" data-range-limit="3">
      <div className="labels">
        <div className="from">
          <label htmlFor="from_id">First Day AUC</label>
          <input
            id="from_id"
            name="from"
            type="number"
            value={fromValue}
            onChange={handleInputChange}
          />
        </div>
        <div className="to">
          <label htmlFor="to_id">Last Day AUC</label>
          <input
            id="to_id"
            name="to"
            type="number"
            value={toValue}
            onChange={handleInputChange}
          />
        </div>
      </div>
      <div className="ui" />
      <div className="labels">
        <label className="min">0 (study first day)</label>
        <label className="max">22</label>
      </div>
    </div>
  );
}

export default Slider;
